import { makeStyles } from '@material-ui/styles';

const globalStyles = makeStyles(() => ({
    page: {
        position: 'relative',
        marginTop: '6rem',
        marginLeft: '2rem',
        border: '1rem solid black',
    },
}));

export default globalStyles;

export const colors = {
    black: '#000000',
    white: '#FFFFFF',
    navbarPrimary: '#9600BC',
    navbarTextColor: '#FFFFFF',
    sidebarPrimary: '#C7ACCE',
};
